import { Link } from 'react-router-dom'

class NavBar extends React.Component {
  render() {
      $(function()  {

        $(".toggle").on("click", function(){

        if($(".item").hasClass("active")){
            $(".item").removeClass("active");
        }
        else{
            $(".item").addClass("active");
        }
    })

  });
    return (
      <nav>
          <Link to="/">Home</Link>



      </nav>
    )
  }
}

export default NavBar
